Job Description:
Statewide Super is the largest and leading South Australian & Northern Territory not-for-profit Industry Superannuation Fund providing expert superannuation advice to over 137,000 members. We manage in excess of $9 billion in funds and have a clear focus on helping our members save for their retirement.
We have an opportunity for an experienced Data Analyst to join our technology team. You will be responsible for examining the unique needs and concerns of the business to analyse and understand its data, with a view to explain and confirm system behaviour. This will be achieved by working closely with various stakeholders to document expectations, and conduct hands-on data analysis to verify and assess system data against these expectations. This comprises a variety of project and remediation work, and includes developing relevant practices and procedures for producing these outcomes.
Key responsibilities will include, but are not limited to:
Understand, inspect, analyse, interpret and assess data from across the organisation to meet business needs;
Source data and information from a variety of sources, not only from traditional databases, to be able to verify, assure and report on system processes and outcomes, to assure business rules are met;
Work with a diverse range of stakeholders and data sources for analysis and input;
Provide risk assessments and recommendations based on data analysis findings.
Establish an understanding of existing business processes and systems and diagnose and propose resolutions to data and reporting system problems by identifying and communicating opportunities for improvement; and
Some assistance in the enhancement of current reporting systems and/or implementation of new reporting systems, particularly in the area of effective business integration of these systems with existing systems and business processes.
We are seeking someone with:
Minimum of 5 years’ previous experience in data analysis or development;
Bachelor’s Degree or equitable experience in computer science, data analysis, or a related field;
Certification, or comparable experience, in MS SQL or similar database products.
Demonstrated experience in effective development of advanced SQL queries to meet business needs;
Experience with business analysis highly valued
Knowledge and experience using reporting tools, such as IBM Cognos or MS Power BI;
Experience in providing quality services to the internal client; and
Good working knowledge of business process and data flows.
If you work with us, you will be working with a group of people who are passionate about growing the financial futures of our community. We value collaboration, integrity, respectful relationships, and most of all, our members.
If you would like to work for an innovative organisation that values and rewards staff involvement and contribution to the business, supports professional development and offers great conditions please forward a cover letter and curriculum vitae to: iwanttowork@statewide.com.au
Statewide Super is an equal opportunity employer, committed to encouraging flexibility, valuing difference and embracing diversity. We pride ourselves on representing the diverse and multicultural communities of our membership and are dedicated to increasing opportunities for Aboriginal and Torres Strait Islander Australians. To learn more, please read our Reconciliation Action Plan.
Please note: It is a condition of employment for this role that a National Police Clearance be obtained. Only successful candidates will be contacted due to the volume of applications received. No Agencies please.

Cutting Edge AI/MedTech Product!
Small and Growing Team - Take Ownership!
Flexibility / WFH


The Biggest Software play in Health Care. Ever.

Big Picture is developing intelligent pathway technology, powering the first single platform for collaborative healthcare and clinical research globally. Our core solution captures structured, protocolized, and clinically validated data, empowering better patient-centered outcomes, and generating new leaps in healthcare. Our teams collaborate in Sydney, London, and remotely; servicing our customer base in Europe, Asia, and North America. To achieve our mission, we drive Product-First frameworks. Fusing design, technology, and clinical thinking together, we create simple software that clinicians deeply love to use. The people who join us will have:
An enthusiasm and readiness to make real change in the global healthcare and technology industry;
The desire to work hard with a great team to solve life-changing, complex and challenging problems;
Our inclusive values support genuine diversity in culture, experience and expertise;
A hunger to build a vision from the ground up, while being proactive in identifying and filling gaps; and
An attitude to make the whole team better because you are there.

This is an incredibly exciting time to join the business and get involved with advanced and innovative greenfield product builds. The net result of your work is going to help millions of people across the world access precision healthcare wherever they are

The Problem.

The strains on our health system are greater than ever. Post-COVID it’s even worse. Rising patient demand, increasing burden of chronic disease, rocketing costs of treatment, make access even more difficult are made even more difficult by a shortage of doctors and resources.

The Solution.

Distributed Care™ by Big Picture is a modular, intelligent platform to re-engineer the entire healthcare value chain & patient journey. Globally.
Using highly protocolized pathways, structured data and SNOMED coded medical terminology, Big Picture has reconstructed and distributed the patient consult, allowing a complete re-imagining of the patient journey to deliver care when and where it’s needed.

As a Data Analyst, you'll use data captured by our Big Picture platform to generate business and product insights. You will support the business development and customer success teams to develop statistical analysis and customer reports. At the same time, you'll be diving into user behavior analytics to help guide Data-Driven Design solutions on our product system. You will have a tertiary degree in Data Science or similar, with 3+ years of experience working in data analytics. We don't require you to have worked in health tech previously but are interested in your passion and ability to analyse complex datasets and produce meaningful insights that drive the right outcomes for our product and customers.

You will be experienced with SQL and have strong skills in multiple programs for statistical analysis and scripting (SAS, SPSS, R, Python, etc). You’ll also be familiar with sophisticated dashboard tools (e.g. Tableau). If you don't, you have the confidence and initiative to pick up these skills quickly. Although you'll work closely with the business development and customer success teams, you'll be able to manage yourself to deliver milestones, make significant decisions and shape the direction of the Big Picture platform for our users. A typical day for your new role might look like:
Utilising data captured by the Big Picture platform to create appropriate reports and presentations for customers;
Providing data analysis and statistical support to the Business Development team;
Establishing key performance indicators to demonstrate the platform's impact and benefits, both economically and clinically;
Contributing to the development of reporting dashboards (both internal and customer-facing); and
Proactively seeking out and driving the implementation of tools to automate reporting processes.

You’ll love this role if you:
Thrive on working in a dynamic organisation that is rapidly evolving and are comfortable navigating through the ambiguity, change, and occasional challenge that it creates;
Have a growth mindset, a high ownership mentality, and a willingness to take responsibility for goals and outcomes;
Excel at interpreting your findings and communicating your analysis to multiple stakeholders;
Have strong technical skills and the desire to develop them further;
Enjoy using your initiative and experience to identify (or ideally, preempt!) issues, while growing and supporting the team with new ways of thinking;
You connect to our mission for better patient healthcare;
Are proud to deliver high-quality solutions.

If this sounds like you please get in touch - cameron@hyre.com.au. Hyre is the exclusive partner to Big Picture.

