Statewide Super is the largest and leading South Australian & Northern Territory not-for-profit Industry Superannuation Fund providing expert superannuation advice to over 137,000 members. We manage in excess of $9 billion in funds and have a clear focus on helping our members save for their retirement.
We have an opportunity for an experienced Data Analyst to join our technology team. You will be responsible for examining the unique needs and concerns of the business to analyse and understand its data, with a view to explain and confirm system behaviour. This will be achieved by working closely with various stakeholders to document expectations, and conduct hands-on data analysis to verify and assess system data against these expectations. This comprises a variety of project and remediation work, and includes developing relevant practices and procedures for producing these outcomes.
Key responsibilities will include, but are not limited to:
Understand, inspect, analyse, interpret and assess data from across the organisation to meet business needs;
Source data and information from a variety of sources, not only from traditional databases, to be able to verify, assure and report on system processes and outcomes, to assure business rules are met;
Work with a diverse range of stakeholders and data sources for analysis and input;
Provide risk assessments and recommendations based on data analysis findings.
Establish an understanding of existing business processes and systems and diagnose and propose resolutions to data and reporting system problems by identifying and communicating opportunities for improvement; and
Some assistance in the enhancement of current reporting systems and/or implementation of new reporting systems, particularly in the area of effective business integration of these systems with existing systems and business processes.
We are seeking someone with:
Minimum of 5 years’ previous experience in data analysis or development;
Bachelor’s Degree or equitable experience in computer science, data analysis, or a related field;
Certification, or comparable experience, in MS SQL or similar database products.
Demonstrated experience in effective development of advanced SQL queries to meet business needs;
Experience with business analysis highly valued
Knowledge and experience using reporting tools, such as IBM Cognos or MS Power BI;
Experience in providing quality services to the internal client; and
Good working knowledge of business process and data flows.
